import React from "react";
import GoogleLogin from "react-google-login";
import axios from "axios";
import {authenticate, isAuth} from "./auth";


function Google() {

    function responseGoogle(res) {
        console.log(res)
    }
    return <GoogleLogin
    clientId="729631658964-7omnf4pr4r90o3oaabgivncs842k5gen.apps.googleusercontent.com"
    buttonText=""
    onSuccess={responseGoogle}
    onFailure={responseGoogle}
    render={renderProps => (
      <button onClick={renderProps.onClick} disabled={renderProps.disabled}>Continue with Google</button>
    )}
    cookiePolicy={'single_host_origin'}
  />

}

export default Google;
